/**
 * {@inheritDoc}
 */
public double getL1Norm() {
    double res = 0;
    Iterator iter = entries.iterator();
    while (iter.hasNext()) {
        iter.advance();
        res += Math.abs(iter.value());
    }
    return res;
}

