    for (Map.Entry<String, Set<Revision>> entry : garbage.entrySet()) {
        for (Revision r : entry.getValue()) {
            main.removeMapEntry(entry.getKey(), r);
            NodeDocument.removeCommitRoot(main, r);
            NodeDocument.removeRevision(main, r);
        }
    }
}

