/**
 * Try to find an entry in the map.
 *
 * @param key the key
 * @param hash the hash
 * @return the entry (might be a non-resident)
 */
Entry<K, V> find(Object key, int hash) {
    int index = hash & mask;
    Entry<K, V> e = entries[index];
    while (e != null && !e.key.equals(key)) {
        e = e.mapNext;
    }
    return e;
}

